function reverseSmaller(arr) { //5 seconds 80k
  var startTime = new Date().getTime();
  var res = [];
  for (var i = arr.length; i--;) {
    var num = arr[i];
    if(!isNaN(num)) {
      var count = 0;
      for(var j = (i+1), l = arr.length; j < l; j++) {
        if(num > arr[j]) {
          count++;
        }
      }
      res[i] = count;
    }
  }
  var endTime = new Date().getTime();
  console.log((endTime-startTime)/1000);
  return res;
}

function smallerByFiltering(arr) {
  var startTime = new Date().getTime();
  var res = [];
  while(arr.length) {
    var num = arr.shift();
    var length = arr.filter(function(n) {
      return num > n;
    }).length;
    res.push(length);
  }
  var endTime = new Date().getTime();
  console.log((endTime-startTime)/1000);
  return res;
}

